import React, { Component } from 'react'
import './footer.css'

class Footer extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div class="footWrapper">
                Footer with Instagram and Facebook link if possible
                </div>
        )
    }
}
export default Footer;
